query:
mutation sitesUpdateSecondaryAzureVSocket ( $accountId:ID! $updateSecondaryAzureVSocketInput:UpdateSecondaryAzureVSocketInput!) {
	sites ( accountId:$accountId ) {
		updateSecondaryAzureVSocket ( input:$updateSecondaryAzureVSocketInput  )  {
			secondaryAzureVSocket {
				site {
					id
					name
				}
				id
				interfaceIp
				floatingIp
			}
		}
	}	
}
